DROP PROCEDURE IF EXISTS `age_class`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `age_class` ()  NO SQL
SELECT YEAR(CURDATE()) - YEAR(u_date) AS age, COUNT(u_id) AS person_count
FROM users
LEFT JOIN users_gender
ON users.g_id = users_gender.g_id
LEFT JOIN users_country
ON users.uc_id = users_country.uc_id
GROUP BY age
HAVING person_count > 0$$

